import React, { Component } from 'react';
import Navigation from './components/Navigation/Navigation'; // on ne précise pas .js car le considère si rien
import Logo from './components/Logo/Logo';
import ImageLinkForm from './components/ImageLinkForm/ImageLinkForm';
import Rank from './components/Rank/Rank'
import './App.css';

class App extends Component {
  render() {
    return ( // parenthèses pour insérer plusieurs lignes
      <div className="App">
        <Particles 
                params={{
                    polygon: {
                        enable: true,
                        type: 'inside',
                        move: {
                            radius: 10
                        },
                        url: 'path/to/svg.svg'
                    }
                }} />
        <Navigation />
        <Logo />
        <Rank />
        <ImageLinkForm />
        {/* <FaceRecognition /> */}
      </div>
    );
  }
}

export default App;
